const Video = ({ src }) => {
  return (
    <iframe
      src={src}
      className="w-full aspect-video"
      title="YouTube video player"
      frameborder="0"
      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture;"
      referrerpolicy="strict-origin-when-cross-origin"
      allowfullscreen
    ></iframe>
  );
};

const Content = ({ children  }) => {
  const ref = useRef();
  const [isVisible, setIsVisible] = useState(false);
  useEffect(() => {
    const observer = new IntersectionObserver(
      () => {
        if (!isVisible) setIsVisible(true);
      },
      { threshold: [0.5] },
    );
    if (ref.current) {
      observer.observe(ref.current);
    }
    return () => observer.disconnect();
  }, [isVisible]);
  return (
    <div ref={ref} className="bg-gray-200">
      {isVisible && children}
    </div>
  );
};

const ImageZoom = ({ src , onClose}) => {
  return (
    <div  onClick={onClose} className={`${src ? "flex" : "invisible"} fixed overflow-auto cursor-zoom-out flex justify-center items-center w-full h-full left-0 top-0 bg-[#00000070]`}>
      <img className="w-[98%] sm:w-[70%]" src={src} alt="imageZoom" />
    </div>
  );
};

